  `handler_name` varchar(64) DEFAULT NULL COMMENT '当前处理人',
  `process_instance_id` varchar(64) DEFAULT NULL COMMENT '工作流id',
  `task_id` varchar(64) DEFAULT NULL COMMENT '工作流任务id',
  `step_name` varchar(64) DEFAULT NULL COMMENT '工作流任务名',
  `is_deleted` tinyint(1) NOT NULL COMMENT '是否删除',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `create_by` bigint(20) DEFAULT NULL COMMENT '创建人',
  `update_by` bigint(20) DEFAULT NULL COMMENT '修改人',
