DROP TABLE IF EXISTS `transaction_flow`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `transaction_flow` (
  `id_` bigint(20) NOT NULL COMMENT 'uuid',
  `transaction_flow_no` varchar(64) NOT NULL COMMENT '交易流水编号',
  `transaction_flow_type` int(11) DEFAULT NULL COMMENT '流水类型（1 锁定流水， 2 实际流水）',
  `transaction_id` bigint(20) DEFAULT NULL COMMENT '原始交易单ID',
  `transaction_no` varchar(64) DEFAULT NULL COMMENT '原始交易单号',
  `po_transaction_id` bigint(20) DEFAULT NULL COMMENT '产品订单采购单ID',
  `po_transaction_no` varchar(64) DEFAULT NULL COMMENT '产品订单采购单号',
  `so_transaction_id` bigint(20) DEFAULT NULL COMMENT '产品订单销售单ID',
  `so_transaction_no` varchar(64) DEFAULT NULL COMMENT '产品订单销售单号',
  `transaction_type` varchar(45) DEFAULT NULL COMMENT '交易类型（产品订单，客户回款，激励政策，走账调拨，押金扣款..）',
  `begin_amount` decimal(18,4) DEFAULT NULL COMMENT '交易前账户余额',
  `transaction_amount` decimal(18,4) DEFAULT NULL COMMENT '交易金额',
  `end_amount` decimal(18,4) DEFAULT NULL COMMENT '交易后账户余额',
  `pay_account` bigint(20) NOT NULL COMMENT '走账公司uuid',
  `pay_account_name` varchar(64) DEFAULT NULL COMMENT '走账公司名称',
  `parent_pay_account` bigint(20) NOT NULL COMMENT '对应供货方走账公司uuid',
  `parent_pay_account_name` varchar(64) DEFAULT NULL COMMENT '对应供货方走账公司名称',
  `customer_name` varchar(64) DEFAULT NULL COMMENT '对应供货方走账公司名称',
  `currency_type` varchar(45) DEFAULT NULL COMMENT '结算货币（1人民币，2美元，3日元...）',
  `payment_type` int(11) DEFAULT NULL COMMENT '结算方式（1 信用额度， 2 账户余额， 3押金）',
  `type` int(11) DEFAULT NULL COMMENT '出账/入账 （出账：1, 入账：2）',
  `credit_logging_id` bigint(20) DEFAULT NULL COMMENT '信用使用流水（用于标记信用还款流水关联的信用流水uuid）',
  `credit_repaid_amount` decimal(18,4) DEFAULT NULL COMMENT '下单产生的信用流水已还金额',
  `credit_repayment_date` datetime DEFAULT NULL COMMENT '这比信用的还款日',
  `credit_repayment_status` int(11) DEFAULT NULL COMMENT '信用流水还款状态（1 未结清，2 已结清）',
  `deposit_pool_id` bigint(20) DEFAULT NULL COMMENT '押金流水关联的专项押金池',
  `deposit_pool_name` varchar(64) DEFAULT NULL COMMENT '交易流水编号',
  `invoice_no` varchar(32) DEFAULT NULL COMMENT '发票号码',
  `difference` decimal(18,4) DEFAULT NULL COMMENT '对账发现的差额',
  `difference_reason` varchar(1024) DEFAULT NULL COMMENT '对账差异原因',
  `credit_limit_id` bigint(20) DEFAULT NULL COMMENT '信用额度设置记录的uuid',
  `create_time` datetime NOT NULL COMMENT '交易时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `is_deleted` tinyint(1) DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`id_`),
  UNIQUE KEY `transaction_flow_UNIQUE` (`transaction_flow_no`),
  KEY `transaction_flow_no` (`transaction_flow_no`),
  KEY `po_transaction_id` (`po_transaction_id`),
  KEY `po_transaction_no` (`po_transaction_no`),
  KEY `so_transaction_id` (`so_transaction_id`),
  KEY `so_transaction_no` (`so_transaction_no`),
  KEY `parent_pay_account` (`parent_pay_account`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
